class Iqons{static svg(t){const s=this._hash(t);return this._svgTemplate(this.colors[s[0]],this.bgColors[s[1]],s[2],s[3],s[4],s[5],s[6])}static render(t,s){s.innerHTML=this.svg(t)}static toDataUrl(t){return`data:image/svg+xml;base64,${btoa(this.svg(t))}`}static _svgTemplate(t,s,e,i,a,r){return this._$svg(this._$iqons(t,s,e,i,a,r))}static _$iqons(t,s,e,i,a,r){return`\n            <g style="color:${t}">\n                <rect fill="${s}" x="0" y="0" width="160" height="160"></rect>\n                <circle cx="80" cy="80" r="40" fill="${t}" stroke="black"></circle>\n                ${this._$use("face",e)}\n                ${this._$use("top",i)}\n                ${this._$use("side",a)}\n                ${this._$use("bottom",r)}\n            </g>`}static _$svg(t){return`\n            <svg viewBox="0 0 160 160" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/2000/xlink" >\n                <clipPath id="hexagon-clip">\n                    <path d="M126.98 8.63l32.07 55.56a16 16 0 0 1 0 16l-32.07 55.56a16 16 0 0 1-13.86 8H48.97a16 16 0 0 1-13.86-8L3.04 80.19a16 16 0 0 1 0-16L35.1 8.63a16 16 0 0 1 13.86-8h64.15a16 16 0 0 1 13.86 8z" fill-rule="evenodd"/>\n                </clipPath>\n                <g clip-path="url(#hexagon-clip)"${t}</g>\n            </svg>`}static _$use(t,s){return`<use width="160" height="160" xlink:href="${location.origin}/iqons/dist/iqons.min.svg#${t}-${this._assetIndex(s)}" />`}static get colors(){return["#ff9800","#E53935","#FDD835","#3f51b5","#03a9f4","#9c27b0","#009688","#EC407A","#8bc34a","#795548"]}static get bgColors(){return["#FF8A80","#F48FB1","#ea80fc","#8c9eff","#80d8ff","#CFD8DC","#1DE9B6","#00C853","#FF9E80","#FFE57F"]}static _assetIndex(t){return t=Number(t)%4+1}static _hash(t){return(""+t.split("").map(t=>Number(t.charCodeAt(0))+3).reduce((t,s)=>t*(1-t)*this.__chaosHash(s),.5)).split("").reduce((t,s)=>s+t,"").substr(4,10)}static __chaosHash(t){let s=1/t;for(let t=0;t<100;t++)s=(1-s)*s*3.569956786876;return s}}